import React from 'react';
import Img from 'react-image';

class Image extends React.Component {
    constructor(props) {
        super(props);
        this.state = {src: props.src}
    }

    render() {
        return (
            <Img
            src={this.state.src}
            loader={<i class="spinner loading icon"></i>}/>
        )
    }
}

export default Image;
